import React from 'react'
import { MainTemplate } from '@UI/Templates'
import '../style.less'

interface PropsType {
	Component: any
	pagePropsType: any
	store: any
}
const MyApp: React.FC<PropsType> = ({ Component, pageProps }) => {
	return (
		<MainTemplate>
			<Component {...pageProps} />
		</MainTemplate>
	)
}

export default MyApp
